import './expenseItem.css';

function ExpenseItem() {
    // const expenseDate = new Date(2022, 9, 19);
    // const expenseTitle = 'Car Insurance';
    // const expenseAmount = 300.00;
    const expenses = [
        {
          id: 'e1',
          title: 'table',
          amount: '120',
          date : new Date (2022, 9, 19)
        },{
          id: 'e2',
          title: 'Box',
          amount: '150',
          date : new Date (2021, 9, 19)
        },
        {
          id: 'e1',
          title: 'shoes',
          amount: '200',
          date : new Date (2022, 9, 19)
        }
      ]

    return (
        <div className="expense-item">
            <div>{ExpenseItem.date.toISOString()}</div>
            <div className="expense-item__description">
                <h2>{ExpenseItem.title}</h2>
                <div className="expense-item__price">{ExpenseItem.amount}</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
